UT.Expression.ready(function(post) {
  "use strict";
  var that = {};

  var frameURL = 'data:image/png;base64,';
  var squareFrameUrl = "data:image/png;base64,";

  that.view = {
    desc: jQuery("#desc"),
    image: jQuery('#image')
  };

  post.on('resize', function() {
    that.view.desc.show();
    that.view.image.utImage({
      post: post,
      size: {
        width: that.view.desc.width(),
        height: that.view.desc.height(),
        flexRatio: false,
        autoCrop: true,
        adaptUI: true
      },
      filter: [
        {
          filter: "imageoverlay",
          parameters: {
            'url':squareFrameUrl,
            'x': 0,
            'y': 0,
            'width': 1,
            'height': 1,
            'rotation': 0,
            'postFilter': 1,
            'merge': false
          }
        }
      ],
      flexRatio: false,
      autoCrop: true
    })
    .on('utImage:change', function(event, newValues){
      var hasImage = !!newValues.data;
      if(hasImage) {
        post.valid(true);
      } else {
        post.valid(false);
      }
    });
  });

  post.size({'height': that.view.desc.width() / 0.7529});
});
